const RangeFilters = ({options}) => {
    // how do?

    // first set up checkboxes, only one selected at a time
    const handleChange = (e) => {
        console.log(e.target.id)
    }

    return (
        <div>
            {options.map((option) => (
                <div key={option.description} className="range-filter">
                    <input onChange={handleChange} type="checkbox" range={option.description} />
                    <p>{option.description}</p>
                </div>
            ))}
        </div>
    )
}

export default RangeFilters
